import './allPages.css'
import { Navbar } from './nav'
export const Help=()=>{
    return(
        <>
            <Navbar />
            <div className='help_container_one'>
            <img src={require('../images/help.png')} alt='img'/>
            <div className='help_container_two'></div>
        </div>
        </>
    )
}
